import React, { Component } from 'react'
import '../css/thanks.css';

export default class Thankyou extends Component {
    constructor(props) {
        super(props);
        setTimeout(() => {
            window.location = "/signup";
        }, 5000);
    }

    render() {
        return ( 
            <>
                <div className="thanksBG"></div>
                <div className="topContainer">
                    <img src={process.env.PUBLIC_URL + '/images/thanks.png'} />
                    <span>We are now setting up your account.</span>
                </div>
            </>
        )
    }
}
